@inheritdoc ILSP8CompatibleERC721
@dev Compatible with ERC721 transferFrom.
Using force=true so that EOA and any contract may receive the tokenId.

@inheritdoc ILSP8CompatibleERC721
@dev Compatible with ERC721 safeTransferFrom.
